import React, { useContext } from 'react';
import { useRouter } from 'next/router';
import { ShowContext } from '../src/context/ShowContext';

const Show = () => {
	const router = useRouter();
	const { shows } = useContext(ShowContext);
	return (
		<div>
			<h1>{router.query.title}</h1>
		</div>
	);
};

export default Show;
